    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then               U.S. Census Bureau's Master Address File / Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
    MTDB representsn               a seamless national file with no overlaps or gaps
    between parts, however, each TIGER/Line shapefile is designed to stand alone as
    an independent datan               set, or they can be combined to cover the entire
    nation. New England City and Town Area (NECTA) Divisions subdivide a NECTA containing
    a single coren               urban area that has a population of at least 2.5 million
    to form smaller groupings of cities and towns. NECTA Divisions are defined by the
    Office ofn               Management and Budget (OMB) and consist of a main city
    or town that represents an employment center, plus adjacent cities and towns associated
    with then               main city or town through commuting ties. Each NECTA Division
    must contain a total population of 100,000 or more. Because NECTA Divisions representn
                  subdivisions of larger NECTAs, it is not appropriate to rank or compare
    NECTA Divisions with NECTAs. Not all NECTAs with urban areas of this size willn
                  contain NECTA Divisions. The NECTA Divisions for the 2010 Census
    are those defined by OMB and published in December 2009.",nt"license_title":
